 .katamari replace pic generator { http://abrax.us/Katamari/ReplacePicGen.php }
.selected {contact table}
table.contactTable {background-image:url(http://fc08.deviantart.net/fs49/f/2009/175/3/1/Smackdown_Divas_2009_by_slishy.jpg) !important;}
table.contactTable * {background-color:transparent;}
table.contactTable {width:300px !important; height:150px !important; padding:0px !important; background-attachment:scroll; background-position:center center; background-repeat:no-repeat; background-color:transparent;}
table.contactTable table, table.contactTable td { padding:0px !important; border:0px; background-color:transparent; background-image:none;}
table.contactTable td.text a img {visibility:hidden !important; border:0px !important;}
table.contactTable a {display:block; height:28px; width:115px;}
table.contactTable .text {font-size:1px !important;}
table.contactTable td.text, table.contactTable a, table.contactTable img {filter:none !important;}
